import React from 'react';
import {
    Link
  } from 'react-router-dom';


class Navbar extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {

        return (
            <div>
                <nav>
                    <row>
                        <col>
                        <Link to="/">Home</Link>
                        </col>
                        <col>
                        <Link to="/mood-list">Mood</Link>
                        </col>
                        <col>
                        <Link to="/users">Users</Link>
                        </col>
                        <col>
                        <Link to="/profile">Profile</Link>
                        </col>
                    </row>
                </nav>
            </div>
        );

    }
};

export default Navbar;
